        Detail: {
          de: {
            Title: '05 Langlaufstadion Toblach Fisloipe - Saskia',
            Header: null,
            BaseText:
              '<p>Die anspruchsvolle Rundloipe ab dem Langlaufstadion in Toblach wird h&auml;ufig als Trainingsstrecke f&uuml;r verschiedene Langlauf-Nationalteams aus der ganzen Welt genutzt.</p><p>&nbsp;</p>',
            Keywords: null,
            Language: 'de',
            MetaDesc:
              'Langlaufen auf bestens präparierten Loipen → 05 Langlaufstadion Toblach Fisloipe - Saskia. Alle Infos zu den mehr als 1.800 Kilometer Loipen in Südtirol. ',
            AuthorTip: null,
            IntroText: null,
            MetaTitle:
              '05 Langlaufstadion Toblach Fisloipe - Saskia • Südtirol',
            SubHeader: null,
            SafetyInfo: null,
            ParkingInfo:
              '<p>Parkpl&auml;tze stehen vor Ort zur Verf&uuml;gung.</p>',
            GetThereText:
              '<p>Wie du Toblach erreichst: <a href="https://www.drei-zinnen.info/de/toblach/toblach/kontakt-service/anreise-mobilitaet.html">https://www.drei-zinnen.info/de/toblach/toblach/kontakt-service/anreise-mobilitaet.html</a></p><p>Von Toblach in Richtung S&uuml;den und weiter in den Ortsteil S&auml;ge.</p>',
            EquipmentInfo: null,
            AdditionalText:
              '<p>Die 5 FIS-Strecken sind durchaus anspruchsvolle Rundstrecken mit abwechslungsreichen Anstiegen und Abfahrten. Start und Ziel der Strecken, auf denen regelm&auml;&szlig;ig Weltcuprennen stattfinden, ist jeweils im Langlaufstadion. Sie f&uuml;hren nach einer einheitlichen Startrunde im Stadion durch kupiertes, bewaldetes Gel&auml;nde am Eingang des H&ouml;hlensteintals. Sie weisen L&auml;ngen zwischen 1,4km und 5,4km auf und sind nach bekannten Toblacher Top-SportlerInnen aus dem Langlauf- und Biathlonbereich benannt.</p><p>Saskia: Saskia Santer (*1977), Toblacher Ex- Biathletin. Zweimalige Teilnehmerin an Olympischen Spielen (Salt Lake City 2002 und Torino 2006), jahrelang Weltcupteilnehmerin</p>',
            PublicTransportationInfo:
              '<p>Mittels &ouml;ffentlicher Verkehrsmittel erreichbar. Die Fahrpl&auml;ne sind auf <a href="http://www.sii.bz.it">www.sii.bz.it</a> hinterlegt.</p>',
          },
          en: {
            Title: '05 Cross country stadium Toblach/Dobbiaco FISI - Saskia',
            Header: null,
            BaseText:
              '<p>Demanding round-trip tours starting at the cross-country stadium in Toblach/Dobbiaco, often used as training tracks by various national cross-country teams from all over the world.</p><p>&nbsp;</p>',
            Keywords: null,
            Language: 'en',
            MetaDesc:
              'Cross-country skiing on perfectly groomed slopes → 05 Cross country stadium Toblach/Dobbiaco FISI - Saskia. All information about Cross-Country trails in South Tyrol',
            AuthorTip: null,
            IntroText: null,
            MetaTitle:
              '05 Cross country stadium Toblach/Dobbiaco FISI - Saskia • South Tyrol',
            SubHeader: null,
            SafetyInfo: null,
            ParkingInfo: '<p>Parking places are available.</p>',
            GetThereText:
              '<p>How to reach Toblach/Dobbiaco: <a href="https://www.drei-zinnen.info/en/dobbiaco/dobbiaco/contact-and-service/arrival-mobility.html">https://www.drei-zinnen.info/en/dobbiaco/dobbiaco/contact-and-service/arrival-mobility.html</a></p><p>From Toblach in southern direction and further on to the district S&auml;ge/Segheria.</p>',
            EquipmentInfo: null,
            AdditionalText:
              '<p>The 5 FIS-Track (Stephanie: 3.8 km Ole: 3.75 km Nathalie: 5 km Saskia: 5 km Albert: Sprint 1.3 km) are very demanding round tracks with varied climbs and descents in the middle of the wood. The starting point and arrival of the tracks is directly in the cross country stadium.</p><p>Saskia: Saskia Santer (*1977), Dobbiaco ex-biathlete. 2 Olympic Games participations (Salt Lake City 2002 and Turin 2006), long-standing World Cup participant.</p>',
            PublicTransportationInfo:
              '<p>Accessible by public transport. The timetables are available on <a href="http://www.sii.bz.it">www.sii.bz.it</a>.</p>',
          },
          it: {
            Title: '05 Stadio sci da fondo Dobbiaco pista FISI - Saskia',
            Header: null,
            BaseText:
              "<p>La pista impegnativa che parte dallo stadio di sci da fondo di Dobbiaco spesso viene utilizzata come circuito d'allenamento dai teams sportivi di varie nazioni.</p><p>&nbsp;</p>",
            Keywords: null,
            Language: 'it',
            MetaDesc:
              'Sci di fondo su piste perfette → 05 Stadio sci da fondo Dobbiaco pista FISI - Saskia. Tutte le informazioni sulle 1800 km di piste da fondo in Alto Adige.',
            AuthorTip: null,
            IntroText: null,
            MetaTitle:
              '05 Stadio sci da fondo Dobbiaco pista FISI - Saskia • Alto Adige',
            SubHeader: null,
            SafetyInfo: null,
            ParkingInfo: 'Parcheggi sono disponibili in loco.',
            GetThereText:
              '<p>Come arrivare a Dobbiaco: <a href="https://www.tre-cime.info/it/dobbiaco/dobbiaco/contatto-servizi/arrivo-mobilita.html">https://www.tre-cime.info/it/dobbiaco/dobbiaco/contatto-servizi/arrivo-mobilita.html</a></p><p>Da Dobbiaco in direzione sud proseguendo fino alla localit&agrave; Segheria.</p>',
            EquipmentInfo: null,
            AdditionalText:
              '<p>I 5 tracciati omologati FIS, ogni anno teatro anche delle gare di Coppa del Mondo, sono circuiti piuttosto impegnativi con un&rsquo;alternanza di salite e discese. Il punto di partenza e di arrivo dei singoli tracciati si trovano all&rsquo;interno dello stadio del fondo, dove si effettua il primo giro, per poi percorrere, su un terreno ondulato e boschivo, il tratto iniziale della Valle di Landro. La lunghezza degli itinerari varia da 1,4 km a 5,4 km e la loro denominazione ricorda i famosi atleti di fondo e biathlon di Dobbiaco.</p><p>Saskia: Saskia Santer (*1977), ex-biatleta di Dobbiaco, ha gareggiato 2 volte a livello olimpico (Salt Lake City 2002 e Torino 2006) e per diversi anni in Coppa del Mondo.</p>',
            PublicTransportationInfo:
              '<p>Accessibile con i mezzi pubblici. Gli orari sono disponibili su <a href="http://www.sii.bz.it">www.sii.bz.it</a>.</p>',
          },
        },
