        Detail: {
          de: {
            Title: '10K Run',
            Header: null,
            BaseText:
              'Knackiger 10 Kilometer Lauf. Bestens geeignet um die eigene Bestmarke in Angriff zu nehmen oder einfach die Gegend zwischen Prad und Glurns kennen zu lernen.',
            Keywords: null,
            Language: 'de',
            MetaDesc:
              'Halten Sie sich gesund und fit und genießen Sie die Natur und Landschaft beim Laufen in Südtirol! → Hier finden Sie • Dauer • Länge und • Höhenunterschiede der Laufstrecke!',
            AuthorTip: null,
            IntroText: null,
            MetaTitle: '10K Run • Laufstrecken in Südtirol',
            SubHeader: null,
            SafetyInfo: null,
            ParkingInfo: null,
            GetThereText: null,
            EquipmentInfo: null,
            AdditionalText:
              'Von der oberen Suldenbachbr&uuml;cke in Prad geht es zuerst durch den Ortsteil Agums. Dann folgen wir, parallel zur Landstra&szlig;e, einem asphaltierten Wirtschaftsweg bis in die Ortschaft Lichtenberg. Am Gasthof Wei&szlig;es R&ouml;ssl und dem Gasthof Schwarzer Adler vorbei laufen wir noch ca. 1 Kilometer Richtung Glurns. Dann f&uuml;hrt uns der Streckenverlauf scharf rechts wieder zur&uuml;ck in Richtung Prad. Nach 200 m &uuml;berqueren wir die Landstra&szlig;e und laufen gut 2 Kilomter auf einem fast gerade verlaufenden Wirtschaftsweg. Am Ende von diesem biegen wir links ab und kommen so auf den Etschradweg. Dieser f&uuml;hrt uns schlie&szlig;lich zu den Prader Fischweihern. Von hier aus geht es, &uuml;ber die Prader Sand und der Prader Sportzone zur&uuml;ck zum Ausgangspunkt.',
            PublicTransportationInfo: null,
          },
          en: {
            Title: '10K Run',
            Header: null,
            BaseText:
              '<p>A challenging 10 km run. The best way to tackle your own best mark or to just get to know the area between Prad and Glurns.</p>',
            Keywords: null,
            Language: 'en',
            MetaDesc:
              'Keep yourself fit and healthy and enjoy the great landscape and pure nature of South Tyrol! → Find all information about • duration • length and • altitude difference!',
            AuthorTip: null,
            IntroText: null,
            MetaTitle: '10K Run • Running routes in South Tyrol',
            SubHeader: null,
            SafetyInfo: null,
            ParkingInfo: null,
            GetThereText: null,
            EquipmentInfo: null,
            AdditionalText:
              'From the upper Suldenbach bridge in Prad, we first cross the locality of Agums. We then follow an asphalted agricultural road that runs parallelly to the back road until we reach the locality of Lichtenberg. After passing the hotels Wei&szlig;es R&ouml;ssl and Schwarzer Adler, we continue for about 1 km in the direction of Glurns. The route takes us sharply to the right, back in the direction of Prad. After 200 m we cross the back road and walk for around 2 km on an almost plain agricultural road. At its end, we turn left and reach the Adige cycle track which finally leads us to the fishing ponds of Prad. From here we return to the starting point across the biotope &ldquo;Prader Sand&rdquo; and the sports area of Prad.',
            PublicTransportationInfo: null,
          },
          it: {
            Title: '10K Run',
            Header: null,
            BaseText:
              '<p>Una corsa sfidante di 10 chilometri. Ideale per migliorare il proprio record o semplicemente scoprire la zona tra Prato allo Stelvio e Glorenza.</p>',
            Keywords: null,
            Language: 'it',
            MetaDesc:
              'TeneteVi sani e in forma e godeteVi la natura e il paesaggio altoatesino mentre fate jogging! → Qui trovate • lunghezza • durata e • dislivelli del percorso!',
            AuthorTip: null,
            IntroText: null,
            MetaTitle: '10K Run • Correre in Alto Adige',
            SubHeader: null,
            SafetyInfo: null,
            ParkingInfo: null,
            GetThereText: null,
            EquipmentInfo: null,
            AdditionalText:
              'Partendo dal ponte superiore del Rio Solda il percorso ci conduce inizialmente attraverso la frazione di Agumes. Seguiamo poi, in parallelo alla strada principale, un sentiero campestre asfaltato fino alla frazione di Montechiaro. Si passa quindi davanti al Ristorante Cavallino Bianco e all&rsquo;Albergo Aquila Nera per proseguire per circa 1 chilometro in direzione Glorenza. Successivamente il percorso, con una svolta decisa a destra, ci conduce nuovamente in direzione di Prato. Dopo 200 m si attraversa la strada provinciale, proseguendo&nbsp; per circa 2 km su un sentiero campestre quasi pianeggiante. Alla fine del sentiero giriamo&nbsp; a sinistra e raggiungiamo la ciclabile dell&rsquo;Adige che ci porta ai laghetti di Prato. Da qui si ritorna al punto di partenza passando per il biotopo &ldquo;Prader Sand&rdquo; e la zona sportiva di Prato.',
            PublicTransportationInfo: null,
          },
        },
